  const {ref} = useWebAnimations({...fadeInDown})

    return(
        <div>
            <div><img  src={sirzia} ref={ref} className="sirzia" alt="sirzia"/></div>
            <div><img src={siraamir} className="siraamir" alt="siraamir"/>

            </div>


    </div>


    )
}
